var title_f23_21_23895="Leishmania life cycle";
var content_f23_21_23895=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F71680&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F71680&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 632px\">",
"   <div class=\"ttl\">",
"    Life cycle of Leishmania",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 612px; height: 432px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Leishmaniasis is transmitted by the bite of infected female phlebotomine sandflies. The sandfly injects the infective stage (ie, promastigotes) from its proboscis during blood meals (1). Promastigotes that reach the puncture wound are phagocytized by macrophages and other types of mononuclear phagocytic cells (2). In these cells progmastigotes transform into the tissue stage of the parasite (i.e., amastigotes) (3), which multiply by simple division and proceed to infect other mononuclear phagocytic cells (4). Parasite, host, and other factors affect whether the infection becomes symptomatic and whether cutaneous or visceral leishmaniasis results. Sandflies become infected by ingesting infected cells during blood meals (5,6). In sandflies, amastigotes transform into promastigotes, develop in the gut (in the hindgut for leishmanial organisms in the Viannia subgenus; in the midgut for organisms in the Leishmania subgenus) (7), and migrate to the proboscis (8).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Centers for Disease Control and Prevention, DPDx. file://www.dpd.cdc.gov/dpdx/HTML/Leishmaniasis.htm.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
