var title_f23_21_23899="Allergens in allergic rhinitis";
var content_f23_21_23899=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F70448&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F70448&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Major causes of allergic rhinitis according to timing of symptoms",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Season",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antigens",
"       </td>",
"       <td class=\"subtitle1\">",
"        Examples",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Early spring",
"       </td>",
"       <td>",
"        Tree pollens",
"       </td>",
"       <td>",
"        Oaks, maples, elms, birches, etc (trees without showy flowers)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Spring/Summer",
"       </td>",
"       <td>",
"        Grass pollens",
"       </td>",
"       <td>",
"        Ryegrass, bluegrass, Bermuda grass",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Late summer",
"       </td>",
"       <td>",
"        Weed pollens",
"       </td>",
"       <td>",
"        Ragweed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Throughout the growing season",
"       </td>",
"       <td>",
"        Fungi",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Throughout the year",
"       </td>",
"       <td>",
"        Household allergens",
"       </td>",
"       <td>",
"        House dust mites, cockroaches, animal dander, molds",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Occupational",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Seed dusts, woods, furs, latex, flour, psyllium, and many others",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Naclerio, R, Solomon, W, JAMA 1997; 278:1842.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
