var title_f23_21_23901="Valve surgery nonischemic MR";
var content_f23_21_23901=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F51845%7ECARD%2F71650&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F51845%7ECARD%2F71650&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ACC/AHA guideline summary: Mitral valve surgery (repair or valve replacement) in patients with nonischemic mitral regurgitation (MR)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class I - There is evidence and/or general agreement mitral valve surgery is indicated in patients with MR in the following settings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Symptomatic severe acute MR.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Severe symptomatic chronic MR (NYHA class II-IV) in the absence of severe left ventricular dysfunction (left ventricular ejection fraction [LVEF] less than 30 percent or end-systolic dimension greater than 55 mm).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Asymptomatic severe chronic MR with LVEF of 30 to 60 percent and/or end-systolic dimension &ge;40 mm.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Among patients with severe chronic MR who require surgery, mitral valve repair is preferred to mitral valve replacement in the majority of patients and the patients should be referred to surgical centers experienced in mitral valve repair.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class IIa - The weight of evidence or opinion is in favor of the usefulness of mitral valve surgery in patients with MR in the following settings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Mitral valve repair in experienced surgical centers in asymptomatic severe chronic MR with preserved left ventricular function (LVEF &gt;60 percent and end-systolic dimension less than 40 mm) if the estimated likelihood of successful repair without residual MR is greater than 90 percent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Asymptomatic patients with severe chronic MR and preserved left ventricular function who have new onset atrial fibrillation or pulmonary hypertension defined as a pulmonary artery systolic pressure &gt;50 mmHg at rest or &gt;60 mmHg with exercise.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; If mitral valve repair is highly likely, severe chronic MR due to a primary abnormality in the mitral valve apparatus (ie, not functional MR), NYHA class III-IV symptoms, and severe left ventricular dysfunction (LVEF less than 30 percent or end-systolic dimension greater than 55 mm).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class IIb - The weight of evidence or opinion is less well established for the usefulness of mitral valve surgery in patients with MR in the following setting",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Mitral valve repair for severe MR due to severe left ventricular dysfunction (LVEF &lt;30 percent) in patients with persistent NYHA class III-IV symptoms despite optimal therapy for heart failure, including biventricular pacing if warranted.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class III - There is evidence and/or general agreement that mitral valve surgery is not useful in patients with MR in the following settings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Isolated mitral valve surgery for mild to moderate MR.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Asymptomatic patients with preserved left ventricular function (LVEF &gt;60 percent and end-systolic dimension less than 40 mm) if there is significant doubt about the feasibility of repair.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Bonow RO, Carabello BA, Chatterjee K, et al. ACC/AHA 2006 guidelines for the management of patients with valvular heart disease. A report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Writing committee to revise the 1998 guidelines for the management of patients with valvular heart disease). J Am Coll Cardiol 2006; 48:e1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ACC/AHA guideline summary: Mitral valve surgery (repair or valve replacement) in adolescents or young adults with congenital mitral regurgitation (MR)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class I - There is evidence and/or general agreement mitral valve surgery is indicated in adolescents or young adults with congenital MR in the following settings:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Symptomatic severe MR with NYHA class III-IV symptoms.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Asymptomatic severe MR and left ventricular dysfunction, defined as a left ventricular ejection fraction (LVEF) &le;60 mmHg.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class IIa - The weight of evidence or opinion is in favor of the usefulness of mitral valve surgery in adolescents or young adults with congenital MR in the following settings:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Mitral valve repair in experienced surgical centers in asymptomatic severe MR and preserved left ventricular function (LVEF &gt;60 percent) if the estimated likelihood of successful repair without residual MR is greater than 90 percent.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class IIb - The weight of evidence or opinion is less well established for the usefulness of mitral valve surgery in adolescents or young adults with congenital MR in the following setting:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Asymptomatic severe and preserved left ventricular function (LVEF &gt;60 percent) if valve replacement is highly likely.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Bonow RO, Carabello BA, Chatterjee, K, et al. ACC/AHA 2006 guidelines for the management of patients with valvular heart disease. A report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Writing committee to revise the 1998 guidelines for the management of patients with valvular heart disease). J Am Coll Cardiol 2006; 48:e1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
